import React from "react";
import 'src/app.css';
function Keyboard() {
    const keys1 = ["Q", "W", "E", "R", "T", "Y", "U", "I", "O", "P"];
    const keys2 = ["A", "S", "D", "F", "G", "H", "J", "K", "L"];
    const keys3 = ["Z", "X", "C", "V", "B", "N", "M"];
    return (
    <div className="keyboard" >
      <div className="line1">
        {keys1}
      </div>
      <div className="line2">
        {keys2}
      </div>
      <div className="line3">
       {keys3}
      </div>
    </div>
  );
}

export default Keyboard;
